using System;\nusing System.Data;\nusing System.Data.SqlClient;\n\npublic class Program\n{\n    public static void Main()\n    {\n        string connectionString = "your_connection_string";\n        string storedProcedureName = "your_stored_procedure";\n\n        using (SqlConnection connection = new SqlConnection(connectionString))\n        {\n            using (SqlCommand command = new SqlCommand(storedProcedureName, connection))\n            {\n                command.CommandType = CommandType.StoredProcedure;\n\n                SqlDataAdapter adapter = new SqlDataAdapter(command);\n                DataSet dataSet = new DataSet();\n\n                connection.Open();\n                adapter.Fill(dataSet);\n\n                // Assuming the last table is the one we need to rename\n                if (dataSet.Tables.Count > 0)\n                {\n                    DataTable lastTable = dataSet.Tables[dataSet.Tables.Count - 1];\n                    lastTable.TableName = "D1Header";\n                }\n\n                // Example of how to access the renamed table\n                DataTable renamedTable = dataSet.Tables["D1Header"];\n                foreach (DataRow row in renamedTable.Rows)\n                {\n                    Console.WriteLine(row["My_800Number"]);\n                }\n            }\n        }\n    }\n}